'rtc/resources/rich_text_component/nls/nonlocalVariableMessages':{"globalExtendedTooltipMessage":"<strong>附加信息</strong><br/><p>在多个函数(或基础工作区)中声明为全局变量的变量会共享该变量的单个副本。您在一个函数中对该变量所做的任何赋值都可用于将该变量声明为全局变量的所有函数。</p><p>如果您是有意以这种方式使用变量，则不是问题。</p><p>但如果您不是有意以这种方式使用变量，则可能会导致意外行为。如果高亮显示指示一个变量的作用域跨多个函数，但这不是您预期的使用方式，请删除该变量的全局声明。</p><p>有关变量和工作区的详细信息，请参阅<a href=\"matlab:helpview([docroot '/techdoc/matlab_prog/matlab_prog.map'],'global_variables')\" target=\"_blank\">全局变量</a>。</p><br/>","globalTooltipMessage":"变量 '${0}' 的作用域为全局。对其值的更改可能会跨多个工作区。","persistentExtendedTooltipMessage":"<strong>附加信息</strong><br/><p>声明为持久变量的变量是声明它的函数的局部变量；然而，MATLAB 在多次调用该函数的过程中，会将它的值保留在内存中。持久变量仅对声明它们的函数可知。这可以防止其他函数或 MATLAB 命令行更改持久变量的值。</p><p>当您清除或修改内存中的函数时，MATLAB 会同时清除该函数声明的所有持久变量。要在 MATLAB 退出之前将函数保留在内存中，请使用 <code><a href=\"matlab:doc mlock\" target=\"_blank\">mlock</a></code>。</p><p>在以下情况下，MATLAB 将返回错误:<ul><li><p>您尝试将变量声明为持久变量，而当前工作区中存在另一个同名变量。</p></li><li><p>您将某个变量指定为函数输入或输出参数，然后尝试将该变量声明为同一函数内的持久变量。例如，以下持久变量声明无效: </p><p><code>function&nbsp;myfun(argA)<br/>persistent&nbsp;argA</code></p></li></ul></p><p>有关变量和工作区的详细信息，请参阅<a href=\"matlab:helpview([docroot '/techdoc/matlab_prog/matlab_prog.map'],'persistent_variables')\" target=\"_blank\">持久变量</a>。</p><br/>","persistentTooltipMessage":"变量 '${0}' 的作用域会应用于同一函数的所有调用。","usedAcrossFunctionsExtendedTooltipMessage":"<strong>附加信息</strong><br/><p>嵌套函数内的变量不仅仅可供其直接函数访问。您在某嵌套函数中赋值或使用的变量 <code>x</code> 位于包含该嵌套函数并访问 <code>x</code> 的最外层函数的工作区中。因此，<code>x</code> 的作用域是此工作区所属的函数，以及嵌套在该函数内的任何级别的所有函数。</p><p>如果您是有意以这种方式使用变量，则不是问题。例如，请参阅关于嵌套函数的 MATLAB 编程演示。</p><p>但如果您不是有意以这种方式使用变量，则可能会导致意外行为。如果高亮显示指示一个变量的作用域跨多个函数，但这不是您预期的使用方式，请考虑:</p><ul><li><p>重命名嵌套函数变量，使其与外部函数变量名称不匹配。</p></li><li><p>将变量作为输入参数传递给函数，而不是直接在嵌套函数中使用该变量。</p></li> </ul><p>有关详细信息，请参阅<a href=\"matlab:helpview([docroot '/techdoc/matlab_prog/matlab_prog.map'],'nested_functions_scope')\" target=\"_blank\">嵌套函数中的变量作用域</a>。</p><br/>","usedAcrossFunctionsTooltipMessage":"变量 '${0}' 的作用域跨多个函数。","_localized":{}}
,
