'l10n/nls/template':{"liveFunction":{"summary":"此函数的简短摘要。","description":"此函数的详细说明。"},"liveClass":{"summary":"此类的简短摘要。","description":"此类的详细说明。","propertySummary":"此属性的简短摘要","constructorSummary":"有关如何创建此类对象的说明。","methodSummary":"method1 的详细说明。"},"exampleContent":"%% 示例标题\n% 示例目标的摘要\n\n%% 第 1 节标题\n% 第一个代码块的说明\na=1;\n\n%% 第 2 节标题\n% 第二个代码块的说明\na=2;\n\n","functionContent":"function [outputArg1,outputArg2] = {fileName}(inputArg1,inputArg2)\n%{fileNameCaps} 此处提供此函数的摘要\n%   此处提供详细说明\noutputArg1 = inputArg1;\noutputArg2 = inputArg2;\nend","classContent":"classdef {fileName}\n   %{fileNameCaps} 此处提供此类的摘要\n   %   此处提供详细说明\n\n   properties\n        Property1\n    end\n\n   methods\n       function obj = {fileName}(inputArg1,inputArg2)\n       %{fileNameCaps} 构造此类的实例\n       %   此处提供详细说明\n       obj.Property1 = inputArg1 + inputArg2;\n       end\n\n       function outputArg = method1(obj,inputArg)\n       %METHOD1 此处提供此方法的摘要\n       %   此处提供详细说明\n       outputArg = obj.Property1 + inputArg;\n       end\n   end\nend","_localized":{}}
